class MaskL1Loss(nn.Layer):
    def __init__(self, eps=1e-6):
        super(MaskL1Loss, self).__init__()
        self.eps = eps
    def forward(self, pred: paddle.Tensor, gt, mask):
        loss = (paddle.abs(pred - gt) * mask).sum() / (mask.sum() + self.eps)
        return loss

